execution.script:
pipeline {
    agent any

    parameters {
        string(name: 'GIT_REPO', description: 'URL of the Git repository', defaultValue: '')
        credentials(name: 'TOKEN', description: 'Private access token for the Git repository', defaultValue: '', required: false)
        string(name: 'REF', description: 'Branch or tag.', trim: true, defaultValue: '1.0.1')    
        string(name: 'IMAGE_TAG', description: 'Image tag of the new version of operator to be installed', trim: true, defaultValue: '0.435.67')
        string(name: 'CHART_VERSION', description: 'Absolute path in the system where the operator charts are downloaded.', trim: true, defaultValue: '2.3.4')
        string(name: 'RELEASE_NAME', description: 'Name of the helm release.', trim: true, defaultValue: 'confluent-demo')
        string(name: 'CHART_LOCATION', description: 'URL to download the operator chart', trim: true, defaultValue: '/var/lib/jenkins/helm-charts/2.3.4')
        string(name: 'NAMESPACE', description: 'Namespace to install the operator chart', trim: true, defaultValue: 'cf')
        credentials(name: 'KUBECONFIG', description: 'Kubeconfig secret', defaultValue: '', required: true)        
    }

    stages {

    stage('git checkout') {
      steps {
        script {
            def token = params.TOKEN
            def repoUrl = params.GIT_REPO
            def repo = repoUrl.split('https://')            
            if (token) {
              withCredentials([string(credentialsId: params.TOKEN, variable: 'TOKEN')]) {
                sh """
                  git clone -c advice.detachedHead=false --depth 1 --branch ${params.REF} https://\$TOKEN@${repo[1]} ${env.BUILD_NUMBER}
                """
              }
           } else {
             sh """
             git clone -c advice.detachedHead=false --depth 1 --branch ${params.REF} ${params.GIT_REPO} ${env.BUILD_NUMBER}
             """
           }
        }
      }
    }

    stage('Check values.yaml') {
            steps {
                   dir("${env.BUILD_NUMBER}") {
                    sh """
                        values_yaml="./values.yaml"
                        if [ -f "\$values_yaml" ]; then
                            echo "values.yaml present: \$values_yaml"
                        else
                            echo "Error: File does not exist: \$values_yaml"
                            exit 1
                        fi
                    """
                }
            }
        }

        stage('Check License') {
            steps {
                dir("${env.BUILD_NUMBER}") {
                    sh """
                        license=\$(yq '.licenseKey' values.yaml)
                        if [[ "\$license" == "null" || "\$license" == "" ]]; then
                            echo "Error: License key not found."
                            exit 1
                        else
                            echo "License check successful."
                        fi
                    """
                }
            }
        }

        stage('Check Operator Image') {
            steps {
                dir("${env.BUILD_NUMBER}") {
                    sh """
                        image_tag=\$(yq '.image.tag' values.yaml)
                        if [[ "\$image_tag" == "${params.IMAGE_TAG}" ]]; then
                            echo "Image tag check successful."
                        else
                            echo "Error: Incorrect image tag. Found \$image_tag, expecting ${params.IMAGE_TAG}."
                            exit 1
                        fi
                    """
                }
            }
        }

        stage('Helm Install') {
            steps {
                dir("${env.BUILD_NUMBER}") {
                  withCredentials([file(credentialsId: params.KUBECONFIG, variable: 'KUBECONFIG')]) {
                    sh """
                        helm upgrade --install \\
                        --atomic --timeout 300s \\
                        --namespace ${params.NAMESPACE} \\
                        --values values.yaml \\
                        ${params.RELEASE_NAME} \\
                        ${params.CHART_LOCATION}/helm/confluent-for-kubernetes
                    """
                  }
                }
            }
        }

        stage('Check Installed Chart') {
            steps {
                withCredentials([file(credentialsId: params.KUBECONFIG, variable: 'KUBECONFIG')]) {
                    sh """
                        status=\$(helm ls -n ${params.NAMESPACE} -o yaml | yq '(.[] | select(.name == "${params.RELEASE_NAME}") | .status)')
                        version=\$(helm ls -n ${params.NAMESPACE} -o yaml | yq '(.[] | select(.name == "${params.RELEASE_NAME}") | .app_version)')
                        echo "Chart status is: \$status."
                        echo "Chart version is: \$version."
                        if [ "\$status" != "deployed" ]; then
                            exit 1
                        fi
                        if [ "\$version" != "${params.CHART_VERSION}" ]; then
                            exit 1
                        fi
                    """
                }
            }
        }
    }
}
